import './App.css';
import React from 'react';

const axios = require("axios");

function App() {
  axios.get("http://localhost:3000")
    .then(function (response) {
      // handle success
      console.log(response);
    })
    .catch(function (error) {
      // handle error
      console.log(error);
    })
    .then(function () {
      // always executed
    });

  return (
    <div className="App">

    </div>
  );
}

export default App;
